(20, 13, 6, 0, 2, 'Gamis Green Filosifi Oxorcities TG-3452', 'gamis-green-filosifi-oxorcities-tg3452', 0, 'pcs', 55000, 57000, 65000, '300', 'gamis1.jpg', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec scelerisque condimentum mattis. Suspendisse potenti. Proin vitae elementum nisi. Aliquam eu pretium risus. Nam varius efficitur consectetur. Aenean vestibulum felis sed mollis faucibus. Interdum et malesuada fames ac ante ipsum primis in faucibus. Proin venenatis est sit amet eleifend vehicula. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer id nunc eu odio ultrices pulvinar non feugiat felis. Duis consequat urna sapien, porta gravida diam venenatis at. Duis at ornare enim, ac accumsan eros. Sed in finibus metus. Etiam blandit tristique orci, sit amet congue dui facilisis id. Donec fermentum diam at orci viverra placerat. Sed nunc lorem, cursus nec vestibulum hendrerit, tempus et libero.</p>\r\n\r\n<p>Donec consequat lacinia fringilla. Proin dapibus justo at elit iaculis, eu rutrum velit dapibus. Phasellus nec augue vel nisl sagittis malesuada vel vel orci. In in euismod massa. Praesent vel blandit arcu. Maecenas eleifend dui in est rhoncus, mattis sollicitudin augue semper. Donec a lectus rhoncus, ornare nunc rutrum, egestas arcu. Aenean dapibus urna non nisl dignissim volutpat.</p>', 'company', '2019-03-22 06:37:29'),
(22, 0, 1, 0, 3, 'APPLE MacBook Pro - Space Gray - Intel Core i5 2.3GHz', 'apple-macbook-pro--space-gray--intel-core-i5-23ghz', 0, 'Unit', 19500000, 20000000, 22500000, '1200', 'a2.jpg', '<h3>Spesifikasi Lebih Tinggi untuk Pacu Produktivitas</h3>\r\n\r\n<p>Apple MacBook Pro edisi terbaru hadir dengan dua pilihan ukuran layar yakni 13 Inch dan 15 Inch. Apple MacBook Pro memiliki fitur terbaru yang memudahkan Anda bekerja dengan mengganti jejeran tombol Function (F) dengan panel sentuh. Fitur bernama Touch Bar ini dapat mengganti tampilan menu di panel sentuh sesuai aplikasi yang Anda gunakan. Namun, jika Anda masih menginginkan versi MacBook tanpa Touch Bar, Apple juga menyediakan varian MacBook Pro 13 Inch tanpa Touch Bar. Jadi Anda masih menggunakan Keyboard dengan tombol F berbentuk fisik seperti Layout Keyboard Laptop konvensional. MacBook Pro tanpa Touch Bar membawa peningkatan performa dibanding pendahulunya. Hadir sebagai otak utama adalah Processor Dual-Core besutan Intel Core i5 berkecepatan 2.3 GHz yang terintegrasi dengan pengolah grafis Intel Iris Graphics 640. Dua buah Port Thunderbolt 3 dengan antarmuka USB-C bisa digunakan untuk transfer data, mengisi baterai, dan Output Display.</p>\r\n\r\n<h3>Dua Pilihan Ukuran MacBook Pro</h3>\r\n\r\n<p>2 model MacBook Pro layar 13 dan 15 Inch, dengan dan tanpa Touch Bar.</p>\r\n', 'admin', '2019-03-23 20:24:24'),
(23, 0, 1, 0, 3, 'HP Business EliteBook X360 1020 G2', 'hp-business-elitebook-x360-1020-g2', 0, 'Unit', 30520000, 31520000, 32520000, '1100', 'a4.jpg', '<h3><strong>Ringan, Kuat, dan Bertenaga</strong></h3>\r\n\r\n<p>HP EliteBook x360 1020 G2 merupakan laptop yang diperuntukkan bagi pebisnis yang memerlukkan tidak hanya bermobilitas tinggi, namun juga bertenaga. Elitebook x360 1020 G2 didukung oleh prosesor IntelÂ® Coreâ¢ i7-7500U sehingga mampu menghadirkan performa yang sangat dapat diandalkan. Selain itu, laptop dengan layar 12.5 beresolusi Full HD ini sudah dilengkapi dengan SSD (Solid State Drive) sebagai media penyimpanan data sehingga kinerjanya semakin kencang. Tentu saja laptop ini memiliki bobot yang sangat ringan agar Anda dapat membawanya kemana saja.&nbsp;</p>\r\n\r\n<h3><strong>Empat Mode Untuk Segala Kebutuhan Bisnis</strong></h3>\r\n\r\n<p>EliteBook x360 1020 G@ hadir dengan beberapa mode yang didesain untuk kebutuhan Anda sehingga dapat menunjang produktivitas Anda. Mode-mode tersebut yaitu Mode Tent yang berbentuk seperti tenda yang sangat cocok untuk presentasi, Mode Tablet yang mentransformasikan laptop Anda menjadi sebuah tablet, Mode Media yang membawa Anda untuk merasakan pengalaman hiburan mendalam, dan yang terakhir adalah Mode Laptop.</p>', 'reseller3', '2019-03-24 10:09:20'),
(24, 0, 1, 0, 3, 'ACER Swift 7 (SF713-51) (Core i7-7Y75) - Gold', 'acer-swift-7-sf71351-core-i77y75--gold', 0, 'Unit', 20465000, 21465000, 22465000, '1100', 'a7.jpg', '<h3><strong>5 Alasan Jitu Memilih Acer Swift 7</strong></h3>\r\n\r\n<p>Pasar ultrabook dunia diramaikan kehadiran Acer Swift 7 yang menjadi salah satu ultrabook paling tipis di dunia. Ketebalan laptop yang super tipis memang ditujukan untuk Anda yang punya mobilitas tinggi. Karena tipis dan ringan, saat dibawa-bawa Acer Swift 7 tidak akan terlalu menyiksa Anda. Berikut ini lima alasan kenapa Anda harus segera memiliki Acer Swift 7:</p>\r\n\r\n<h3>1) Laptop Paling Tipis di Dunia</h3>\r\n\r\n<p>Acer Swift 7 menjadi laptop paling tipis di dunia saat diluncurkan pertama kali pada awal Juli 2016. Ini sangat wajar karena ketebalan laptop satu ini hanya 0.39 inci. Pemilihan material berkualitas juga membuatnya sangat ringan. Perpaduan warna emas di bagian dalam dan hitam matte di luar menciptakan kesan elegan dan modern. Dengan memakai Acer Swift 7 tentu akan meningkatkan kepercayaan diri Anda.</p>\r\n\r\n<h3>2) Layar Sentuh Jernih Seluas 13 Inci</h3>\r\n\r\n<p>Konten layar yang Anda lihat jadi terlihat jernih berkat dukungan layar sentuh seluas 13.3 inci beresolusi Full HD. Teknologi Acer Color Intelligence mengatur gamma dan saturasi agar bisa menghasilkan warna lebih kaya. Acer Swift 7 juga menggunakan panel layar jenis IPS sehingga dari sudut mana pun Anda melihatnya, kontras dan warna layar tidak pudar. Tak usah khawatir layar tergores, karena sudah menggunakan kaca Corning Gorilla Glass yang 2 kali lebih kuat dari kaca biasa.&nbsp;</p>', 'reseller3', '2019-03-24 10:11:03'),
(25, 0, 1, 0, 3, 'DELL Business Latitude 7290 (Core i7-8650U)', 'dell-business-latitude-7290-core-i78650u', 0, 'Unit', 20449000, 21449000, 22449000, '1100', 'a8.jpg', '<h3><strong>Alasan Jitu Memilih DELL Business Latitude 7290</strong></h3>\r\n\r\n<p>Pasar ultrabook dunia diramaikan kehadiran DELL Business Latitude 7290 yang menjadi salah satu ultrabook paling tipis di dunia. Ketebalan laptop yang super tipis memang ditujukan untuk Anda yang punya mobilitas tinggi. Karena tipis dan ringan, saat dibawa-bawa DELL Business Latitude 7290 tidak akan terlalu menyiksa Anda. Berikut ini lima alasan kenapa Anda harus segera memiliki DELL Business Latitude 7290:</p>\r\n\r\n<p>DELL Business Latitude 7290 menjadi laptop paling tipis di dunia saat diluncurkan pertama kali pada awal Juli 2016. Ini sangat wajar karena ketebalan laptop satu ini hanya 0.39 inci. Pemilihan material berkualitas juga membuatnya sangat ringan. Perpaduan warna emas di bagian dalam dan hitam matte di luar menciptakan kesan elegan dan modern. Dengan memakai DELL Business Latitude 7290 tentu akan meningkatkan kepercayaan diri Anda.</p>\r\n\r\n<p>Konten layar yang Anda lihat jadi terlihat jernih berkat dukungan layar sentuh seluas 13.3 inci beresolusi Full HD. Teknologi Acer Color Intelligence mengatur gamma dan saturasi agar bisa menghasilkan warna lebih kaya. Acer Swift 7 juga menggunakan panel layar jenis IPS sehingga dari sudut mana pun Anda melihatnya, kontras dan warna layar tidak pudar. Tak usah khawatir layar tergores, karena sudah menggunakan kaca Corning Gorilla Glass yang 2 kali lebih kuat dari kaca biasa.&nbsp;</p>', 'reseller3', '2019-03-24 10:13:19'),
